if selected_state == "Delhi":
    st.write("# Here are all the stats on Delhi")
    st.write("**CATEGORY:** Union Teritorries With legislatures")
    st.write(
        "**Predictions of SALARY EXPENDITURE for Delhi when year = 2014-2015, 2015-2016:**",
        predictions_delhi,
    )

    year_to_predict = st.number_input(
        label="Enter the year to be predicted salary expenditure from 2008 to 2014 dataset trained",
        min_value=2015,
        max_value=2030,
    )

    if year_to_predict:
        # Assuming these are your linear regression coefficients for Delhi
        slope = 450.00
        intercept = -901384.29

        predicted_salary = slope * year_to_predict + intercept
        st.write("**Here is the prediction for your expected year:**", predicted_salary)
    st.image("data:image/png;base64,")
